	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-StubItem-git,
.github-Git-root {
  flex: 1;
  display: flex;
}
.github-Git {
  flex: 1;
  display: flex;
  flex-direction: column;
  min-width: 0;
  font-family: system-ui;
  font-size: 12px;
  color: #9fa5b1;
  -webkit-user-select: none;
  cursor: default;
}
.github-Git.is-loading {
  color: rgba(159, 165, 177, 0.6);
}
.github-Git.no-repository,
.github-Git.too-many-changes,
.github-Git.unsupported-directory {
  display: flex;
  justify-content: center;
  font-size: 1.25em;
  padding: 30px;
  text-align: center;
}
.github-Git.no-repository > *,
.github-Git.too-many-changes > *,
.github-Git.unsupported-directory > * {
  margin: 10px 0;
}
.github-Git.no-repository h1,
.github-Git.too-many-changes h1,
.github-Git.unsupported-directory h1 {
  margin-bottom: 30px;
}
.github-Git.no-repository button,
.github-Git.too-many-changes button,
.github-Git.unsupported-directory button {
  overflow: hidden;
  text-overflow: ellipsis;
}
.github-Git-LargeIcon:before {
  margin-right: 0;
  margin-bottom: 50px;
  width: auto;
  height: auto;
  font-size: 8em;
  color: #545862;
}
